// CometAPIClient is the base struct for all request methods
type CometAPIClient struct {
	AdminUsername string
	AdminPassword string
	ServerURL     string
	Username      string
	Password      string
}

// NewAdminCometAPIClient constructs and returns an instance of CometAPIClient with Admin credentials
func NewAdminCometAPIClient(serverURL, username, password string) (*CometAPIClient, error) {
	_, err := url.ParseRequestURI(serverURL)
	if err != nil {
		return nil, err
	}

	return &CometAPIClient{
		ServerURL:     serverURL,
		AdminUsername: username,
		AdminPassword: password,
	}, nil
}

// NewCometAPIClient constructs and returns an instance of CometAPIClient
func NewCometAPIClient(serverURL, username, password string) (*CometAPIClient, error) {
	_, err := url.ParseRequestURI(serverURL)
	if err != nil {
		return nil, err
	}

	return &CometAPIClient{
		ServerURL: serverURL,
		Username:  username,
		Password:  password,
	}, nil
}

// Request is a convenience method wrapping a basic http request
func (this *CometAPIClient) Request(admin bool, method, path string, data map[string]string) ([]byte, error) {
	u, err := url.ParseRequestURI(this.ServerURL)
	if err != nil {
		return nil, err
	}
	u.Path = path

	body := url.Values{}
	for key, value := range data {
		body.Set(key, value)
	}

	req, err := http.NewRequest(strings.ToUpper(method), u.String(), strings.NewReader(body.Encode()))
	if err != nil {
		return nil, err
	}
	req.Header.Add("Content-type", "application/x-www-form-urlencoded")

	if admin {
		req.Header.Add("X-Comet-Admin-AuthType", "Password")
		req.Header.Add("X-Comet-Admin-Username", this.AdminUsername)
		req.Header.Add("X-Comet-Admin-Password", this.AdminPassword)
	} else {
		body.Set("AuthType", "Password")
		body.Set("Username", this.Username)
		body.Set("Password", this.Password)
	}

	resp, err := http.DefaultClient.Do(req)
	if err != nil {
		return nil, err
	}
	defer resp.Body.Close()

	respBody, err := ioutil.ReadAll(resp.Body)
	if err != nil {
		return nil, err
	}

	// Test for CometAPIResponseMessage (Error)
	carm := &CometAPIResponseMessage{}
	err = json.Unmarshal(respBody, carm)
	if err == nil && carm.Status != 0 {
		return nil, fmt.Errorf("Error returned from API (code %d): %s", carm.Status, carm.Message)
	}

	return respBody, nil
}

